import{_ as a,c as e,o as i,a4 as t}from"./chunks/framework.CFdyflnk.js";const _=JSON.parse('{"title":"区分原生APP页面和H5页面","description":"","frontmatter":{},"headers":[],"relativePath":"other/matrix/distinguish-app-h5.md","filePath":"other/matrix/distinguish-app-h5.md","lastUpdated":1740901752000}'),l={name:"other/matrix/distinguish-app-h5.md"},r=t('<h1 id="区分原生app页面和h5页面" tabindex="-1">区分原生APP页面和H5页面 <a class="header-anchor" href="#区分原生app页面和h5页面" aria-label="Permalink to &quot;区分原生APP页面和H5页面&quot;">​</a></h1><p>APP开发模式：Hybrid APP开发（即混合模式，半原生半H5页面）</p><ul><li>原生是Native APP</li><li>H5就是Web App</li></ul><h2 id="一、看断网的情况" tabindex="-1">一、看断网的情况 <a class="header-anchor" href="#一、看断网的情况" aria-label="Permalink to &quot;一、看断网的情况&quot;">​</a></h2><ul><li><p>把手机的网络断掉。然后点开页面。然后可以正常显示的东西就是原生写的。</p></li><li><p>显示404或者错误页面的是html页面。</p></li></ul><h2 id="二、看布局边界" tabindex="-1">二、看布局边界 <a class="header-anchor" href="#二、看布局边界" aria-label="Permalink to &quot;二、看布局边界&quot;">​</a></h2><ul><li>可以打开 开发者选项中的显示布局边界，页面元素很多的情况下布局是一整块的是h5的，布局密密麻麻的是原生控件。页面有布局的是原生的否则为h5页面。（仅针对安卓手机适用）</li></ul><h2 id="三、看复制文章的提示" tabindex="-1">三、看复制文章的提示 <a class="header-anchor" href="#三、看复制文章的提示" aria-label="Permalink to &quot;三、看复制文章的提示&quot;">​</a></h2><ul><li><p>长按页面试试，如果出现文字选择、粘贴功能的是H5页面，否则是native原生的页面。</p></li><li><p>有些原生APP开放了复制粘贴功能或者关闭了。而H5的css屏蔽了复制选择功能等等情况。需要通过对目标测试APP进行对比才可知。</p></li></ul><h2 id="四、看加载的方式" tabindex="-1">四、看加载的方式 <a class="header-anchor" href="#四、看加载的方式" aria-label="Permalink to &quot;四、看加载的方式&quot;">​</a></h2><p>如果在打开新页面导航栏下面有一条加载的线的话，这个页面就是H5页面，如果没有就是原生的。微信里面打开我们的H5页面常见的有个绿色的 加载线条。</p><h2 id="五、看app顶部-导航栏是否会有关闭的操作" tabindex="-1">五、看app顶部 导航栏是否会有关闭的操作 <a class="header-anchor" href="#五、看app顶部-导航栏是否会有关闭的操作" aria-label="Permalink to &quot;五、看app顶部 导航栏是否会有关闭的操作&quot;">​</a></h2><ul><li>如果APP顶部导航栏当中出现了关闭按钮或者有关闭的图标，那么当前的页面肯定的H5，原生的不会出现（除非设计开发者故意弄的）</li></ul><h2 id="六、判断页面-下拉刷新的时候" tabindex="-1">六、判断页面 下拉刷新的时候 <a class="header-anchor" href="#六、判断页面-下拉刷新的时候" aria-label="Permalink to &quot;六、判断页面 下拉刷新的时候&quot;">​</a></h2><ul><li><p>前提是要有下拉刷新的功能</p></li><li><p>如果界面没有明显刷新现象的是原生的，如果有明显刷新现象（比如闪一下）的是H5页面（ios和android）</p></li></ul><h2 id="七、下拉页面的时候显示网址提供方的一定是h5" tabindex="-1">七、下拉页面的时候显示网址提供方的一定是H5 <a class="header-anchor" href="#七、下拉页面的时候显示网址提供方的一定是h5" aria-label="Permalink to &quot;七、下拉页面的时候显示网址提供方的一定是H5&quot;">​</a></h2><h2 id="reference" tabindex="-1">Reference <a class="header-anchor" href="#reference" aria-label="Permalink to &quot;Reference&quot;">​</a></h2><p>注： 部分内容来自网络</p>',18),h=[r];function o(n,p,s,d,c,u){return i(),e("div",null,h)}const m=a(l,[["render",o]]);export{_ as __pageData,m as default};
